import './App.css';
import ResponsiveAppBar from './components/AppBar';
import IntroBox from './components/IntroBox';
import ProjectsBox from './components/ProjectsBox';

function App() {
  return (
    <div className="App">
      <ResponsiveAppBar />
      <div className='mx-auto container'>
        <IntroBox />

      </div>
      <div className='mx-auto container'>
      <ProjectsBox />
        </div>

    </div>
  );
}

export default App;
